import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Rating from '@material-ui/lab/Rating';
import PanoramaFishEyeTwoToneIcon from '@material-ui/icons/PanoramaFishEyeTwoTone';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

const StyledRating = withStyles({

    icon: {
        color: 'grey',
    },
    iconFilled: {
        color: '#B6C512',
    },
    root: {
        margin: '0px',
    }
})(Rating);

const StyledBox = withStyles({
    root: {
        margin: '0px',
        padding: '0px',
        width: '100%',
        display: 'block',
        alignItems: 'center',
    }
})(Box);





export default function ScrRatingChart() {
    const [value, setValue] = React.useState(2);
    return (
        <div>

            <StyledBox component="fieldset" mb={0} borderColor="transparent">
                
                <StyledRating
                    name="customized-color"
                    value={value}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
                {value !== null && <Box style={{display:"inline", marginBottom : "10px"}}>{value}</Box>}
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
                <StyledRating
                    name="customized-color"
                    value={5.5}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
                <StyledRating
                    name="customized-color"
                    value={5.5}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="subtitle2" >Marché 50%</Typography>
                <StyledRating
                    name="customized-color"
                    value={5.5}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>

            <StyledBox component="fieldset" mb={3} borderColor="transparent">
                <Typography component="legend" color="white" variant="caption" >Marché 50%</Typography>
                <StyledRating
                    name="customized-color"
                    value={5.5}
                    readOnly
                    max={10}
                    precision={0.5}
                    icon={<PanoramaFishEyeTwoToneIcon fontSize="inherit" />}
                />
            </StyledBox>


        </div>
    );
}
